import React from "react";

const SingleDropDown = ({item1,item2}) =>{

    return (
        <div>
            <div class="dropdown">
                <button class="buttons dropdown-toggle" type="button" id="dropdownMenuButton1" data-bs-toggle="dropdown" aria-expanded="false">
                    M
                </button>
                <ul class="dropdown-menu" aria-labelledby="dropdownMenuButton1">
                    <li><a class="dropdown-item" href="#">{item1}</a></li>
                    <li><a class="dropdown-item" href="#">{item2}</a></li>
                    <li><a href="#"></a></li>
                </ul>
            </div>
        </div>
    );
}

export default SingleDropDown;
